Create Table Pengirim (
    id_pengirim varchar(5) primary key,
    nama_depan_pengirim varchar(50),
    nama_belakang_pengirim varchar(50),
    alamat_pengirim varchar(50)
);

Create Table Cabang(
  id_cabang varchar(5) primary key,
  nama_cabang varchar(50),
  alamat_cabang varchar(50)
);

Create Table Admin (
    id_admin varchar(5),
    id_cabang varchar(5),
    nama_depan_admin varchar(50),
    nama_belakang_admin varchar(50),
    CONSTRAINT PK_Admin  PRIMARY KEY (id_admin),
    CONSTRAINT FK_Admin FOREIGN KEY (id_cabang) REFERENCES Cabang(id_cabang)
);


Create Table Penerima(
    id_penerima varchar(5) primary key,
    nama_depan_penerima varchar(50),
    nama_belakang_penerima varchar(50),
    alamat_penerima varchar(50)
);

Create Table Layanan(
    id_layanan varchar(4) primary key,
    nama_layanan varchar(50),
    biayaperjarak numeric
);

Create Table DataPaket(
  id_paket varchar(5),
  id_pengirim varchar(5),
  id_penerima varchar(5),
  id_layanan varchar(5),
  id_admin varchar(5),
  hari_kirim varchar(50),
  tanggal_kirim DATE,
  waktu_kirim varchar(4),
  jenis_paket varchar(50),
  berat_paket numeric(2,1),
  harga_paket numeric,
  biaya numeric,
  CONSTRAINT PK_DataPaket  PRIMARY KEY (id_paket),
  CONSTRAINT FK1_DataPaket FOREIGN KEY (id_pengirim) REFERENCES Pengirim(id_pengirim),
  CONSTRAINT FK2_DataPaket FOREIGN KEY (id_penerima) REFERENCES Penerima(id_penerima),
  CONSTRAINT FK3_DataPaket FOREIGN KEY (id_layanan) REFERENCES Layanan(id_layanan),
  CONSTRAINT FK4_DataPaket FOREIGN KEY (id_admin) REFERENCES Admin(id_admin)
);

Create Table Laporan (
  id_laporan varchar(5),
  id_paket varchar(5),
  hari_terima varchar(50),
  tanggal_terima DATE,
  waktu_terima varchar(4),
  penerima_paket varchar(50),
  CONSTRAINT PK_Laporan  PRIMARY KEY (id_laporan),
  CONSTRAINT FK_Laporan FOREIGN KEY (id_paket) REFERENCES DataPaket(id_paket)
);


